INSERT INTO `sutra_action_item` VALUES  (86,'Add','TAB_change_fancy()',227,'adf',1,'Method','<html><head><style type=\"text/css\" media=\"screen\"><!--.syntax { font-family: \"Consolas\", \"Courier New\", Courier, mono, serif; font-size: 12pt; background-color: #E7E5DC; width: 100%; margin: 0px 0 18px 0 !important; }.syntax ol { background-color: #FFFFFF; margin: 0px 0px 1px 0px !important; padding: 0px; color: #5C5C5C; }.syntax ol li { background-color: #F8F8F8; padding: 0 3px 0 10px !important; }.syntax ol li.alt { background-color: #FFFFFF; }.syntax ol li span { color: black; font-weight: normal; }.syntax .comment { color: #1B8A28; font-style: italic; font-weight: bold; }.syntax .string { color: gray; }.syntax .keyword { color: #4000FF; font-weight: bold; }.syntax .servoy { color: #00B400; font-weight: bold; }.syntax .special { color: #FF1300; font-weight: bold; }.syntax .devnotes { color: #B00D00; font-style: italic; }.syntax .number { color: #FF00FF; }--></style></head><body><div class=\"syntax\">The contents of this method were last refreshed on 10-30-2007 at 17:13:35<ol>\n<li class=\"alt\"><span><span class=\"comment\">//set&nbsp;formname</span></span></li>\n<li class=\"\"><span><span class=\"keyword\">var</span>&nbsp;formName&nbsp;<span class=\"special\">=&nbsp;</span><span class=\"servoy\">application</span>.getMethodTriggerFormName<span class=\"string\">(</span><span class=\"string\">)</span></span></li>\n<li class=\"alt\"><span></span></li>\n<li class=\"\"><span><span class=\"comment\">//set&nbsp;the&nbsp;tab&nbsp;panel&nbsp;name</span></span></li>\n<li class=\"alt\"><span><span class=\"keyword\">var</span>&nbsp;tabPanelName&nbsp;<span class=\"special\">=&nbsp;</span><span class=\"string\">\'tab_example\'</span></span></li>\n<li class=\"\"><span></span></li>\n<li class=\"alt\"><span><span class=\"comment\">//set&nbsp;prefix&nbsp;for&nbsp;element</span></span></li>\n<li class=\"\"><span><span class=\"keyword\">var</span>&nbsp;prefix&nbsp;<span class=\"special\">=&nbsp;</span><span class=\"string\">\'tab_\'</span></span></li>\n<li class=\"alt\"><span></span></li>\n<li class=\"\"><span><span class=\"comment\">//get&nbsp;button&nbsp;that&nbsp;called</span></span></li>\n<li class=\"alt\"><span><span class=\"keyword\">if</span>&nbsp;<span class=\"string\">(</span>arguments<span class=\"keyword\">[</span><span class=\"number\">0</span><span class=\"keyword\">]</span><span class=\"string\">)</span>&nbsp;<span class=\"string\">{</span></span></li>\n<li class=\"\"><span>&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"keyword\">var</span>&nbsp;btnClicked&nbsp;<span class=\"special\">=&nbsp;</span>prefix&nbsp;<span class=\"special\">+</span>&nbsp;arguments<span class=\"keyword\">[</span><span class=\"number\">0</span><span class=\"keyword\">]</span></span></li>\n<li class=\"alt\"><span><span class=\"string\">}</span></span></li>\n<li class=\"\"><span><span class=\"keyword\">else</span>&nbsp;<span class=\"string\">{</span></span></li>\n<li class=\"alt\"><span>&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"keyword\">var</span>&nbsp;btnClicked&nbsp;<span class=\"special\">=&nbsp;</span><span class=\"servoy\">application</span>.getMethodTriggerElementName<span class=\"string\">(</span><span class=\"string\">)</span></span></li>\n<li class=\"\"><span><span class=\"string\">}</span></span></li>\n<li class=\"alt\"><span></span></li>\n<li class=\"\"><span><span class=\"comment\">//get&nbsp;number&nbsp;of&nbsp;tabs</span></span></li>\n<li class=\"alt\"><span><span class=\"keyword\">var</span>&nbsp;tab_num&nbsp;<span class=\"special\">=&nbsp;</span><span class=\"servoy\">forms</span><span class=\"keyword\">[</span>formName<span class=\"keyword\">]</span>.<span class=\"servoy\">elements</span><span class=\"keyword\">[</span>tabPanelName<span class=\"keyword\">]</span>.getMaxTabIndex<span class=\"string\">(</span><span class=\"string\">)</span></span></li>\n<li class=\"\"><span></span></li>\n<li class=\"alt\"><span><span class=\"keyword\">var</span>&nbsp;ori