 (1457,'Actions','REC_delete()',398,'Delete blog',6,'Method','<html><head><style type=\"text/css\" media=\"screen\"><!--.syntax { font-family: \"Consolas\", \"Courier New\", Courier, mono, serif; font-size: 12pt; background-color: #E7E5DC; width: 100%; margin: 0px 0 18px 0 !important; }.syntax ol { background-color: #FFFFFF; margin: 0px 0px 1px 0px !important; padding: 0px; color: #5C5C5C; }.syntax ol li { background-color: #F8F8F8; padding: 0 3px 0 10px !important; }.syntax ol li.alt { background-color: #FFFFFF; }.syntax ol li span { color: black; font-weight: normal; }.syntax .comment { color: #1B8A28; font-style: italic; font-weight: bold; }.syntax .string { color: gray; }.syntax .keyword { color: #4000FF; font-weight: bold; }.syntax .servoy { color: #00B400; font-weight: bold; }.syntax .special { color: #FF1300; font-weight: bold; }.syntax .devnotes { color: #B00D00; font-style: italic; }.syntax .number { color: #FF00FF; }--></style></head><body><div class=\"syntax\">The contents of this method were last refreshed on 09-3-2008 at 07:27:46<ol>\n<li class=\"alt\"><span></span></li>\n<li class=\"\"><span><span class=\"comment\">/*</span></span></li>\n<li class=\"alt\"><span><span class=\"comment\">&nbsp;*&nbsp;&nbsp;&nbsp;&nbsp;TITLE&nbsp;&nbsp;&nbsp;&nbsp;:&nbsp;&nbsp;&nbsp;&nbsp;REC_delete</span></span></li>\n<li class=\"\"><span><span class=\"comment\">&nbsp;*&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span></li>\n<li class=\"alt\"><span><span class=\"comment\">&nbsp;*&nbsp;&nbsp;&nbsp;&nbsp;MODULE&nbsp;&nbsp;&nbsp;:&nbsp;&nbsp;&nbsp;&nbsp;fw_AC_access_control</span></span></li>\n<li class=\"\"><span><span class=\"comment\">&nbsp;*&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span></li>\n<li class=\"alt\"><span><span class=\"comment\">&nbsp;*&nbsp;&nbsp;&nbsp;&nbsp;ABOUT&nbsp;&nbsp;&nbsp;&nbsp;:&nbsp;&nbsp;&nbsp;&nbsp;de