 (9,'2008-03-06 14:07:29','2008-09-01 17:25:07','Beware of the young doctor and the old barber.','Benjamin Franklin','2008-03-06 00:00:00',1,0,'f5875a1a-9640-40cb-bd53-909184f57bd4',1),
 (10,'2008-03-06 14:08:41','2008-09-01 17:25:07','The avoidance of taxes is the only intellectual pursuit that carries any reward.','John Maynard Keynes','2008-03-07 00:00:00',1,0,'5ce7a6b6-379d-499a-9b13-922599c4d521',1),
 (11,'2008-03-06 14:09:57','2008-09-01 17:25:07','The artist doesn\'t have time to listen to the critics. The ones who want to be writers read the reviews, the ones who want to write don\'t have the time to read reviews.','William Faulkner','2008-03-08 00:00:00',1,0,'59e0a941-4518-44e6-a199-9996e2715492',1),
 (12,'2008-03-06 14:11:22','2008-09-01 17:25:07','Life is like an ice-cream cone, you have to lick it one day at a time.','Charlie Brown','2008-03-09 00:00:00',1,1,'59308d07-dfb2-4441-a4e3-7b6744064362',1),
 (13,'2008-03-06 14:12:20','2008-09-01 17:25:07','Success covers a multitude of blunders.','George Bernard Shaw','2008-03-10 00:00:00',1,0,'7ea72537-7300-4ffc-92a5-144698aca9be',1),
