 (44,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
 (100,'Match','Required for syntax coloring','var objReturn = new Object()\n\nobjReturn.value = value;\nobjReturn.index = index;\nobjReturn.length = value.length;\nobjReturn.css = css;\n\nreturn objReturn','value','index','css',NULL,NULL),
 (101,'Highlighter',NULL,NULL,NULL,NULL,NULL,NULL,NULL),
 (102,'SortCallback',NULL,'// sort matches by index first\nif(m1.index < m2.index)\n	return -1;\nelse if(m1.index > m2.index)\n	return 1;\nelse\n{\n	// if index is the same, sort by length\n	if(m1.length < m2.length)\n		return -1;\n	else if(m1.length > m2.length)\n		return 1;\n}\nreturn 0;','m1','m2',NULL,NULL,NULL),
 (103,'CreateElement',NULL,'var result = document.createElement(name);\nresult.highlighter = this;\nreturn result;','name',NULL,NULL,NULL,NULL),
 (104,'GetMatches','Required for coloration','var fxMatch = func\n\nvar index = 0;\nvar match = null;\nvar matches = new Array()\n\nwhile((match = regex.exec(code)) != null) \n	matches[matches.length] = fxMatch(match[0], match.index, css)\n\nreturn matches','code','regex','css','func',NULL),
 (105,'AddBit',NULL,'if(str == null || str.length == 0)\n	return;\n\nvar span = this.CreateElement(\'SPAN\');\n\n//	str = str.replace(/&/g, \'&amp;\');\nstr = str.replace(/ /g, \'&nbsp;\');\nstr = str.replace(/</g, \'&lt;\');\n//	str = str.replace(/&lt;/g, \'<\');\n//	str = str.replace(/>/g, \'&gt;\');\nstr = str.replace(/\\n/gm, \'&nbsp;<br>\');\n\n// when adding a piece of code, check to see if it has line breaks in it \n// and if it does, wrap individual line breaks with span tags\nif(css != null)\n{\n	if((/br/gi).test(str))\n	{\n		var lines = str.split(\'&nbsp;<br>\');\n		\n		for(var i = 0; i < lines.length; i++)\n		{\n			span = this.CreateElement(\'SPAN\');\n			span.className = css;\n			span.innerHTML = lines[i];\n			\n			this.div.appendChild(span);\n			\n			// don\'t add a <BR> for the last line\n			if(i + 1 < lines.length)\n				this.div.appendChild(this.CreateElement(\'BR\'));\n		}\n	}\n	else\n	{\n		span.className = css;\n		span.innerHTML = str;\n		this.div.appendChild(span);\n	}\n}\nelse\n{\n	span.innerHTML = str;\n	this.div.appendChild(span);\n}','str','css',NULL,NULL,NULL),
 (106,'IsInside',NULL,'if(match == null || match.length == 0)\n	return false;\n\nfor(var i = 0; i < this.matches.length; i++)\n{\n	var c = this.matches[i];\n	\n	if(c == null)\n		continue;\n\n	if((match.index > c.index) && (match.index < c.index + c.length))\n		return true;\n}\n\nreturn false;','match',NULL,NULL,NULL,NULL),
 (107,'ProcessRegexList',NULL,'for(var i = 0; i < this.regexList.length; i++)\n	this.GetMatches(this.regexList[i].regex, this.regexList[i].css);',NULL,NULL,NULL,NULL,NULL),
 (108,'ProcessSmartTabs',NULL,'var lines	= code.split(\'\\n\');\nvar result	= \'\';\nvar tabSize	= 4;\nvar tab	= \'\\t\';\n\n// Go through all the lines and do the \'smart tabs\' magic.\nfor(var i = 0; i < lines.length; i++)\n	result += ProcessLine(lines[i], tabSize) + \'\\n\';\n\nreturn result;','code',NULL,NULL,NULL,NULL),
 (109,'InsertSpaces',NULL,'var left	= line.substr(0, pos);\nvar right	= line.substr(pos + 1, line.length);	// pos + 1 will get rid of the tab\nvar spaces	= \'\';\n\nfor(var i = 0; i < count; i++)\n	spaces += \' \';\n\nreturn left + spaces + right;','line','pos','count',NULL,NULL),
 (110,'ProcessLine',NULL,'if(line.indexOf(tab) == -1)\n	return line;\n\nvar pos = 0;\n\nwhile((pos = line.indexOf(tab)) != -1)\n{\n	// This is pretty much all there is to the \'smart tabs\' logic.\n	// Based on the position within the line and size of a tab, \n	// calculate the amount of spaces we need to insert.\n	var spaces = tabSize - pos % tabSize;\n	\n	line = InsertSpaces(line, pos, spaces);\n}\n\nreturn line;','line','tabsize',NULL,NULL,NULL),
 (111,'SwitchToList',NULL,'// thanks to Lachlan Donald from SitePoint.com for this <br/> tag fix.\nvar html = this.div.innerHTML.replace(/<(br)\\/?>/gi, \'\\n\');\nvar lines = html.split(\'\\n\');\n\n\nfor(var i = 0, lineIndex = this.firstLine; i < lines.length - 1; i++, lineIndex++)\n{\n	var li = this.CreateElement(\'LI\');\n	var span = this.CreateElement(\'SPAN\');\n	\n	// uses .line1 and .line2 css styles for alternating lines\n	li.className = (i % 2 == 0) ? \'alt\' : \'\';\n	span.innerHTML = lines[i] + \'&nbsp;\';\n\n	li.appendChild(span);\n	this.ol.appendChild(li);\n}\n\nthis.div.innerHTML	= \'\';',NULL,NULL,NULL,NULL,NULL),
 (112,'Highlight',NULL,'var pos	= 0;\n\nif(code == null)\n	code = \'\';\n\nthis.originalCode = code;\nthis.code = Chop(Unindent(code));\nthis.div = this.CreateElement(\'DIV\');\nthis.bar = this.CreateElement(\'DIV\');\nthis.ol = this.CreateElement(\'OL\');\nthis.matches = new Array();\n\nthis.div.className = \'dp-highlighter\';\nthis.div.highlighter = this;\n\nthis.bar.className = \'bar\';\n\n// set the first line\nthis.ol.start = this.firstLine;\n\nif(this.CssClass != null)\n	this.ol.className = this.CssClass;\n\nif(this.collapse)\n	this.div.className += \' collapsed\';\n\nif(this.noGutter)\n	this.div.className += \' nogutter\';\n\nthis.code = this.ProcessSmartTabs(this.code);\n\nthis.ProcessRegexList();	\n\n// if no matches found, add entire code as plain text\nif(this.matches.length == 0)\n{\n	this.AddBit(this.code, null);\n	this.SwitchToList();\n	this.div.appendChild(this.bar);\n	this.div.appendChild(this.ol);\n	return;\n}\n\n// sort the matches\nthis.matches = this.matches.sort(coloring.Highlighter.SortCallback);\n\n// The following loop checks to see if any of the matches are inside\n// of other matches. This process would get rid of highligted strings\n// inside comments, keywords inside strings and so on.\nfor(var i = 0; i < this.matches.length; i++)\n	if(this.IsInside(this.matches[i]))\n		this.matches[i] = null;\n\n// Finally, go through the final list of matches and pull the all\n// together adding everything in between that isn\'t a match.\nfor(var i = 0; i < this.matches.length; i++)\n{\n	var match = this.matches[i];\n\n	if(match == null || match.length == 0)\n		continue;\n\n	this.AddBit(Copy(this.code, pos, match.index), null);\n	this.AddBit(match.value, match.css);\n\n	pos = match.index + match.length;\n}\n\nthis.AddBit(this.code.substr(pos), null);\n\nthis.SwitchToList();\nthis.div.appendChild(this.bar);\nthis.div.appendChild(this.ol);','code',NULL,NULL,NULL,NULL),
 (113,'Trim',NULL,'return str.replace(/^\\s*(.*?)[\\s\\n]*$/g, \'$1\');','str',NULL,NULL,NULL,NULL),
 (114,'Chop',NULL,'return str.replace(/\\n*$/, \'\').replace(/^\\n*/, \'\');','str',NULL,NULL,NULL,NULL),
 (115,'Unindent',NULL,'var lines = str.split(\'\\n\');\nvar indents = new Array();\nvar regex = new RegExp(\'^\\\\s*\', \'g\');\nvar min = 1000;\n\n// go through every line and check for common number of indents\nfor(var i = 0; i < lines.length && min > 0; i++)\n{\n	if(Trim(lines[i]).length == 0)\n		continue;\n		\n	var matches = regex.exec(lines[i]);\n\n	if(matches != null && matches.length > 0)\n		min = Math.min(matches[0].length, min);\n}\n\n// trim minimum common number of white space from the begining of every line\nif(min > 0)\n	for(var i = 0; i < lines.length; i++)\n		lines[i] = lines[i].substr(min);\n\nreturn lines.join(\'\\n\');','str',NULL,NULL,NULL,NULL),
 (116,'Copy',NULL,'return string.substr(pos1, pos2 - pos1);','string','pos1','pos2',NULL,NULL),
 (117,'GetKeywords',NULL,'return \'\\\\b\' + str.replace(/ /g, \'\\\\b|\\\\b\') + \'\\\\b\';','str',NULL,NULL,NULL,NULL),
 (118,'HighlightAll','','var elements = [];\nvar highlighter = null;\nvar registered = {};\nvar propertyName = \'innerHTML\';\n\n// for some reason IE doesn\'t find <pre/> by name, however it does see them just fine by tag name... \nFindTagsByName(elements, name, \'pre\');\nFindTagsByName(elements, name, \'textarea\');\n\nif(elements.length == 0)\n	return;\n\n// register all brushes\nfor(var brush in coloring.Brushes)\n{\n	var aliases = coloring.Brushes[brush].Aliases;\n\n	if(aliases == null)\n		continue;\n	\n	for(var i = 0; i < aliases.length; i++)\n		registered[aliases[i]] = brush;\n}\n\n\nfor(var i = 0; i < elements.length; i++)\n{\n	var element = elements[i];\n	var options = FindValue(\n			element.attributes[\'class\'], element.className, \n			element.attributes[\'language\'], element.language\n			);\n	var language = \'\';\n	\n	if(options == null)\n		continue;\n	\n	options = options.split(\':\');\n	\n	language = options[0].toLowerCase();\n\n	if(registered[language] == null)\n		continue;\n	\n	// instantiate a brush\n	highlighter = new coloring.Brushes[registered[language]]();\n	\n	// hide the original element\n	element.style.display = \'none\';\n\n	// write out custom brush style\n	var headNode = document.getElementsByTagName(\'head\')[0];\n	if(highlighter.Style && headNode)\n	{\n		var styleNode = document.createElement(\'style\');\n		styleNode.setAttribute(\'type\', \'text/css\');\n\n		if(styleNode.styleSheet) // for IE\n		{\n			styleNode.styleSheet.cssText = highlighter.Style;\n		}\n		else // for everyone else\n		{\n			var textNode = document.createTextNode(highlighter.Style);\n			styleNode.appendChild(textNode);\n		}\n\n		headNode.appendChild(styleNode);\n	}\n	\n	// first line idea comes from Andrew Collington, thanks!\n	highlighter.firstLine = (firstLine == null) ? parseInt(GetOptionValue(\'firstline\', options, 1)) : firstLine;\n\n	highlighter.Highlight(element[propertyName]);\n	\n	highlighter.source = element;\n\n	element.parentNode.insertBefore(highlighter.div, element);\n}','name','showGutter','showControls','collapseAll','firstLine'),
 (119,'FindValue',NULL,'var a = arguments;\n\nfor(var i = 0; i < a.length; i++)\n{\n	if(a[i] == null)\n		continue;\n		\n	if(typeof(a[i]) == \'string\' && a[i] != \'\')\n		return a[i] + \'\';\n\n	if(typeof(a[i]) == \'object\' && a[i].value != \'\')\n		return a[i].value + \'\';\n}\n\nreturn null;',NULL,NULL,NULL,NULL,NULL),
 (120,'GetOptionValue',NULL,'var regex = new RegExp(\'^\' + name + \'\\\\[(\\\\w+)\\\\]$\', \'gi\');\nvar matches = null;\n\nfor(var i = 0; i < list.length; i++)\n	if((matches = regex.exec(list[i])) != null)\n		return matches[1];\n\nreturn defaultValue;','name','list','defaultValue',NULL,NULL),
 (121,'FindTagsByName',NULL,'var tags = document.getElementsByTagName(tagName);\n\nfor(var i = 0; i < tags.length; i++)\n	if(tags[i].getAttribute(\'name\') == name)\n		list.push(tags[i]);','list','name','tagName',NULL,NULL),
 (122,'Servoy',NULL,'var keywords =	\'abstract boolean break byte case catch char class const continue debugger \' +\n				\'default delete do else enum export extends final finally float for \' +\n				\'Function if implements import in instanceof interface package return super switch \' +\n				\'this throw throws transient try typeof var void while with\';\n\nvar servoy =	\'application controller currentcontroller databaseManager elements forms foundset \' +\n				\'globals history i18n plugins security ServoyException utils\';\n\nvar special =	\'null undefined NaN\';\n\nthis.regexList = [\n	{ regex: new RegExp(\'//[^TODO,MEMO].*$\', \'gm\'),					css: \'comment\' },			// one line comments\n	{ regex: new RegExp(\'/\\\\*[\\\\s\\\\S]*?\\\\*/\', \'gm\'),				css: \'comment\' },			// multiline comments\n	{ regex: new RegExp(\'\"(?:\\\\.|(\\\\\\\\\\\\\")|[^\\\\\"\"\\\\n])*\"\',\'g\'),		css: \'string\' },			// double quoted strings\n	{ regex: new RegExp(\"\'(?:\\\\.|(\\\\\\\\\\\\\')|[^\\\\\'\'\\\\n])*\'\", \'g\'),	css: \'string\' },			// single quoted strings\n	{ regex: new RegExp(\'[(){}]\', \'gm\'),							css: \'string\' },			// brackets () {}\n	{ regex: new RegExp(\'\\\\b([\\\\d]+(\\\\.[\\\\d]+)?|0x[a-f0-9]+)\\\\b\', \'gi\'),	css: \'number\' },	// numbers\n	{ regex: new RegExp(\'\\&lt;(?:=)*|&gt;(?:=)*|!(?:=)*|[[]|]|(?:==)\', \'gm\'), css: \'keyword\'},	// comparison, square []\n	{ regex: new RegExp(this.GetKeywords(keywords), \'gm\'),			css: \'keyword\' },			// keywords\n	{ regex: new RegExp(this.GetKeywords(servoy), \'gm\'),			css: \'servoy\' },			// servoy words\n	{ regex: new RegExp(this.GetKeywords(special), \'gm\'),			css: \'special\' },			// special red words\n	{ regex: new RegExp(\'[*-]|[+]|=[^=]|[/][^/*]\', \'gm\'),			css: \'special\' },			// operators\n	{ regex: new RegExp(\'//[TODO,MEMO].*$\', \'gm\'),					css: \'devnotes\' }			// todo developer notes\n	];\n\nthis.CssClass = \'servoy\';',NULL,NULL,NULL,NULL,NULL);
