INSERT INTO `sutra_solution` VALUES  (1,'Data Sutra','Build great applications',1000,740,NULL,NULL,NULL,1,1,2,22,1,200,'servoy',1,'#',100,NULL,NULL,'M-d-yyyy',0,1,NULL,1,NULL,NULL,'','http://www.data-sutra.com/',NULL,NULL,NULL,0,200,225,200,225,200,180,200,200,200,'en',NULL,0,0,NULL,NULL,'',200,200,'<html>\n<head>\n\n<style type=\"text/css\" media=\"screen\">\n<!--\nbody { margin: 0px 0px 0px 0px; background-color: #FFFFFF; }\n.big { font-size: 300%; padding: 0px 10px 0px 10px; }\n.bigorange { font-size: 200%; color: rgb(216, 98, 77); padding: 0px 10px 0px 10px; }\n.orange { font-size: 125%; color: rgb(216, 98, 77); padding: 0px 10px 0px 10px; }\n.mediumbig { font-size: 175%; padding: 0px 10px 0px 10px; }\n.footer { padding: 0px 10px 5px 10px; color: white; text-decoration: none; font-size: 110%; background-color: rgb(216, 98, 77); }\np { font-size: 115%; text-indent: 0cm; padding: 0px 10px 0px 10px; }\np.nonp { font-size: 115%; padding: 0px 10px 0px 10px; margin: 0px 0px 0px 0px;}\n.li { padding: 5px 0px 10px 10px; }\n-->\n</style>\n</head>\n\n<body>\n<p>\n<span class=\'big\'>DATA SUTRA </span><span class=\'bigorange\'> for SERVOY</span>\n<br>\n<span class=\'mediumbig\'>WHAT SERVOY IS TO SQL, DATA SUTRA IS TO SERVOY</span>\n</p>\n\n<p><span class=\'orange\'>imagination, flexibility, effectiveness...existing together</span></p>\n\n<p>The Mosaic Frameworks for Servoy is unlike any applications frameworks you have ever encountered. Utilizing the power of the Servoy IDE, we have created a comprehensive platform for greatly accelerating development and deployment of advanced business applications.</p>\n\n<p><span class=\'orange\'>create applications fast</span></p>\n<div class=\"li\">\n<p class=\"nonp\">&nbsp;&nbsp;Save 100s of hours not developing common solution tasks</p>\n<p class=\"nonp\">&nbsp;&nbsp;Jump-start your workflow screens with our many templates and examples</p>\n<p class=\"nonp\">&nbsp;&nbsp;Take advantage of powerful features without coding</p>\n<p class=\"nonp\">&nbsp;&nbsp;Easily organize large solutions with our solution abstraction model</p>\n<p class=\"nonp\">&nbsp;&nbsp;Increase user buy-in with an intuitive interface and inline help screens</p>\n<p class=\"nonp\">&nbsp;&nbsp;Close the gap between specifications and end results with rapid prototyping</p>\n<p class=\"nonp\">&nbsp;&nbsp;Embrace change with our flexible navigation engine</p>\n</div>\n\n<p class=\'nonp\'><span class=\'orange\'>even small businesses can afford a custom application</span></p>\n\n<p>Created over the course of several years and completely rewritten for Servoy 3.5, the Mosaic Frameworks is a complete solution out of the box. It is only missing one thing your business workflow screens.</p>\n\n<!--\n<p></p>\n<p></p>\n<p></p>\n<p></p>\n<p></p>\n<p></p>\n<p></p>\n<div class=\"footer\">Mosaic Frameworks awaits!&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Copyright &copy; 2008</div>\n-->\n\n</body>\n</html>\n',0,'Welcome to Data Sutra!','<html>\n<head>\n<style type=\"text/css\" media=\"screen\"><!--\nbody { margin: 0px 0px 0px 0px; background-color: #FFFFFF; }\np { padding: 0px 10px 0px 10px; font-weight: bold; font-family: Verdana; font-size: 11pt; vertical-align: middle; color: #323A4B; }\n--></style>\'\n</head>\n<body>\n<p>Developer login:<br>mbolton/rocks<br><br>User login:<br>bill/rocks</p>\n</body>\n</html>','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,NULL,'',0,179,1);
