INSERT INTO `sutra_tooltip` VALUES  (463,'7ff623c6-181f-46ad-b48a-6724b876d11c','2008-10-31 10:39:21','2009-03-08 23:27:08','en','Organization list','<html><head></head><body> Organizations and staff screen is an optional way to group people. Staff can be assigned to user login records as a way to associate login information with specific people.<br><br>\n\n Specifically, the organization structure here filters the staff value list where you assign a staff member to a user login record making it easier to find the person you are looking for.<br><br>\n\nThis is an arbitrary grouping structure that can be modified to fit your organization\'s or SaaS deployment needs.<br><br>\n\nSee the contextual help items on the Access & Control user pane for additional information on how to link in your own custom organization/people structure if it differs from that presented here.</body></html>',NULL,1,NULL,'_ds_AC_access_control','AC_0_organization','help_organization'),
 (464,'60910f04-2d64-4500-be27-af32ad79f53d','2008-10-31 10:39:22','2008-11-04 11:22:19','en','Staff list','<html><head></head><body>Refer to the contextual help on organizations list</body></html>',NULL,1,NULL,'_ds_AC_access_control','AC_0_organization','help_staff'),
 (465,'01bed78e-5d75-453a-8be3-6a2d28856a6a','2008-10-31 10:39:22','2008-11-04 11:22:19','en','Actions','<html><head></head><body><strong>Solution level actions</strong><br><br>\n\nThe concept of the actions registry is to give you an abstract way to connect workflow logic to group privileges. This allows you to create branching logic based on who is logged in. For example, a manager can create and approve a purchase order but a data entry person can only create purchase orders.<br><br>\n\nInstead of hard coding the group id of the current logged in user in your workflow to do this kind of a check, you pass the registered action ID to a frameworks callback function (CALLBACK_authenticate_registry_action([registry ID]) ) which returns true or false. Base your branching logic on this returned value.<br><br>\n\nTO IMPLEMENT<br><br>\n\n1) First \"register\" an action. Create a record on this screen. All the data is arbitrary -- just make sure that the registry field is unique. You will be using the registry value in your code to return true or false depending on whether or not the current user\'s group is allowed to do this action.<br><br>\n\n2) Assign this action to any groups that are allowed to do the action (Access and control > Groups > Actions tab).<br><br>\n\n3) In your code, check that this action is allowed for the currently logged in user. Use the callback function \"CALLBACK_authenticate_registry_action([registry ID]). This will return true or false based on the group privilege of the currently logged in user.</body></html>',NULL,1,NULL,'_ds_AC_access_control','AC_0F_solution__prefs_1F_action','help_ac_registry'),
 (483,'996b9268-c22f-446d-b2c9-06b4908f2319','2008-10-31 10:39:24','2008-11-04 11:22:19','en','Quote editor','<html><head></head><body> <strong>Quote editor</strong><br><br>\n Use text only, no html tag formatting<br>\n Show/hide the editor with the arrow button<br>\n\n</body></html>',NULL,1,NULL,'_ds_AC_access_control','AC_0F_blog__qotd','help_blog_qotd'),
 (484,'2b948dbf-467e-4a71-9205-905ca42f670a','2008-10-31 10:39:24','2008-11-04 11:22:19','en','List of quotes','<html><head></head><body> <strong>List of quotes </strong><br><br>\n List of quotes to display on specific dates<br>\n Selected default quote will be displayed if no quote assigned to a date<br>\n</body></html>',NULL,1,NULL,'_ds_AC_access_control','AC_0F_blog__qotd','help_blog_qotd_edit'),
 (488,'189f3930-5a7a-4bd6-9fe2-51bd85d70cdb','2008-10-31 10:39:24','2008-11-04 11:22:19','en','List of blog entries','<html><head></head><body> <strong>List of blog entries</strong><br><br>  These will display in reverse chronological order on the blog page<br>  Only checked entries under \"Show\" will be displayed<br>  Use the group and user columns to assign an author<br>  </body></html>',NULL,1,NULL,'_ds_AC_access_control','AC_0F_blog__entry','help_blog_entries'),
 (489,'ed05b8c6-4ae9-408c-ac7c-1ed884a55397','2008-10-31 10:39:24','2008-11-04 11:22:19','en','Blog entry editor','<html><head></head><body>\n<strong>Blog entry editor</strong><br><br>\n Use html to format your entries<br>\n You can select text then click a formatting button to put in the proper html formatting tags in<br>\n Use the \"URL\" button to insert links to web pages as this will insert the correct Servoy method to open the link in the default browser<br>\n\n\n\n</body></html>',NULL,1,NULL,'_ds_AC_access_control','AC_0F_blog__entry','help_blog_entry_edit'),
 (494,'a315340b-9215-4611-91d2-63374a0ddf97','2008-10-31 10:39:25','2008-11-04 11:22:19','en','Navigation sets','List of navigation sets for this group. You can specify the order they show up in the drop down list.\n\nThe comments are useful to the user who is assigned to more than one group as they show up when they choose which group to enter the solution as.',NULL,1,1,'_ds_AC_access_control','AC_0F_group__navigation','help_ac_group_navigation'),
 (495,'48c95530-0966-4955-bc61-7536bd31ae49','2008-10-31 10:39:25','2008-11-04 11:22:19','en','Landing form','Choose which form the user will arrive at upon logging in.',NULL,1,NULL,'_ds_AC_access_control','AC_0F_group__navigation','help_ac_group_navigation_first'),
 (507,'cc9604ec-f9fa-4359-8a2f-86b533344e4d','2008-10-31 10:39:26','2008-11-04 11:22:19','en','User details','<html><head></head><body><strong>User details</strong><br><br>\n\n\"Name\" is the user name a user logs in with<br><br>\n\n\"Organization\" and \"Staff\" are optional fields and not necessary for Access and Control to work. This is just a way to connect login records with specific people records located elsewhere. The value lists here are based on the records created in Access and control > Organizations & Staff.<br><br>\n\nAdvanced: if you use your own structure to connect login records to people, attach your own value lists to these fields. You may even want to add additional fields and value lists depending on how complex your grouping structure is.<br><br>\n\nNote that form changes here will be overwritten by future updates to Frameworks. So keep careful record of any form changes so that you can redo after an update.</body></html>',NULL,1,NULL,'_ds_AC_access_control','AC_0F_user','help_ac_user_details'),
 (508,'963d8a2f-a33c-4501-bbbd-eef301e245f1','2008-10-31 10:39:26','2008-11-04 11:22:19','en','Account options','Account options\n\nSelect \"Change pass at login\" to force the user to set a new password at login. This flag will deselect automatically once they\'ve done this.\n\n\"Cannot change pass\" hides the change password option in the Frameworks action menu.\n\n\"Pass never expires\" overrides any password rules settings in Access and Control > Preferences > Password.\n\n\"Account disabled\" allows you to disable the login record without deleting it.',NULL,1,NULL,'_ds_AC_access_control','AC_0F_user','help_ac_user_options'),
 (511,'76cad735-9ce1-401c-a621-9997d152aba5','2008-10-31 10:39:26','2008-11-04 11:22:19','en','<html><head></head><body>Display options for your blog</body></html>','<html><head></head><body>\n1- Banner: This is the blog name<br>\n2- # Posts: How many posts to show<br>\n3- Hide date: Don\'t display blog post date<br>\n4- Hide author: Don\'t display blog author<br>\n5- Always fixed: Use \"Fixed splash screen (tab below) instead of blog<br>\n6- Auto quote: Quotes of the day pulled from <a href=\'javascript:globals.CODE_url_handler(\"http://www.quoteworld.org\")\'>http://www.quoteworld.org</a> instead of the \"Quote of the day\" tab below\n</body></html>',NULL,1,NULL,'_ds_AC_access_control','AC_0F_blog','help_blog_details'),
 (512,'feaf5f42-9f99-431c-b0a4-9bb72cd401f8','2008-10-31 10:39:26','2008-11-04 11:22:19','en','Blog header code','<html><head></head><body>Blog header code: use html but do not use the html and body tags. The code here gets put inside the blog html body block.</body></html>',NULL,1,NULL,'_ds_AC_access_control','AC_0F_blog','help_blog_footer'),
 (513,'a93c11dc-1481-4b16-ae4e-c7e9242a11ee','2008-10-31 10:39:26','2008-11-04 11:22:19','en','Blog footer code','<html><head></head><body>Blog footer code: use html but do not use the html and body tags. The code here gets put inside the blog html body block.</body></html>',NULL,1,NULL,'_ds_AC_access_control','AC_0F_blog','help_blog_header'),
 (514,'c8cfdf33-1ddd-439f-9e3a-84bea80af81c','2008-10-31 10:39:26','2008-11-04 11:22:19','en','Admin modes','Choose which admin modes this group is allowed to access.',NULL,1,NULL,'_ds_AC_access_control','AC_0F_group','help_ac_group_admin_modes'),
 (515,'395a2d11-f5e9-489d-afc1-a95a24279f6f','2008-10-31 10:39:26','2008-11-04 11:22:19','en','Group details','<html><head></head><body> <strong>Group details</strong><br><br> - Name: required field<br> - Description: optional<br> - Login method A: code to run before record rules are applied. Populate your custom globals here. Do not touch any forms!<br> - Login method B: code to run before user interface is shown. It is safe to touch any forms in your code.<br> - Logout method: run specific logout code for this group. This runs in addition to any methods you may assign for solution logout and solution quit. The hooks for these are listed under the Solution configuration pane.<br>  </body></html>',NULL,1,NULL,'_ds_AC_access_control','AC_0F_group','help_ac_group_details'),
 (516,'5d867202-5e4a-467e-9674-779bd89c4493','2008-10-31 10:39:26','2008-11-04 11:22:19','en','Logging','<html><head></head><body>Logging allows you to track how a user is using your solution. Log data is stored in two tables in the \"mosaic_frameworks\" database connection:<br><br>  1- mosaic_log: group level log items<br> 2- mosaic_access_log: session data for a login session. Related to servoy_client_stats table in the repository. This happens whether group logging is turned on or not.<br><br>  Turning on group level logging will slow the solution down slightly. </body></html>',NULL,1,NULL,'_ds_AC_access_control','AC_0F_group','help_ac_group_logging'),
 (517,'1cfc4a28-e2fe-421f-92cf-c35ff4285daf','2008-10-31 10:39:27','2008-11-04 11:22:19','en','Servoy bars','Toolbars are mainly for the developer. The \"edit\" and \"text\" toolbars work in smart client. No toolbars work in web client.',NULL,1,NULL,'_ds_AC_access_control','AC_0F_group','help_ac_group_servoybars'),
 (518,'0f18908d-43a7-449f-83b9-9c726c508d2b','2008-10-31 10:39:27','2008-11-04 11:22:19','en','User modes','Choose which user modes this group is allowed to access.',NULL,1,NULL,'_ds_AC_access_control','AC_0F_group','help_ac_group_user_modes'),
 (522,'dc21a975-20ec-4107-816e-61228d917d34','2008-10-31 10:39:27','2008-11-04 11:22:19','en','Password rules','Specify various password rules depending on the level of security your solution requires.  When passwords expire, the user is prompted to create a new one.',NULL,1,NULL,'_ds_AC_access_control','AC_0F_solution__prefs_1F_rules','help_ac_rules'),
 (523,'d5143abb-0206-4e81-9ff8-1ab97b190431','2008-10-31 10:59:37','2008-11-04 11:22:19','en','Miscellaneous section of the blog screen (bottom right)','<html><head></head><body>This section can be anything you want. Display a list of items, bring in an RSS feed, show a picture, etc<br><br>  Use full html page code here.</body></html>',NULL,1,NULL,'_ds_AC_access_control','AC_0F_blog__misc',NULL),
 (524,'5f89794f-6ad6-4b79-a161-ea06eba8900c','2008-10-31 11:06:08','2008-11-04 11:22:19','en','Fixed splash screen to use instead of the blog','<html><head></head><body>\nThis code will be shown instead of the blog items if you have \"Always fixed\" checked.<br><br>\n\nUse full html page code here.</body></html>',NULL,1,NULL,'_ds_AC_access_control','AC_0F_blog__fixed',NULL),
 (525,'31b8a564-2759-4f00-9881-c519e6bdaa60','2008-10-31 11:57:17','2008-11-04 11:22:19','en','Delete report',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__button_2F_action_item__report_3L','btn_delete'),
 (526,'a356608e-aebf-41ed-a71c-7b709f948ee9','2008-10-31 11:57:17','2008-11-04 11:22:19','en','Move selected item down',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__button_2F_action_item__report_3L','btn_down'),
 (527,'19b1167e-bae0-4358-ad8a-3a19efc802ff','2008-10-31 11:57:17','2008-11-04 11:22:19','en','Move selected item up',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__button_2F_action_item__report_3L','btn_up'),
 (528,'2ee03ed4-ad3e-4f39-beb7-46a626c9b7a2','2008-10-31 11:57:17','2008-11-04 11:22:19','en','Add to findable columns',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__replace_2L__all_columns','btn_add'),
 (529,'73dbf205-856e-48fe-bfc7-d8b3bee3511b','2008-10-31 11:57:17','2008-11-04 11:22:19','en','Filter specification','<html><head></head><body>\nFilter specification is comprised of the following components (very similar to the Servoy relation specification form):  \n<br><br>\n1- Table column to filter on. All columns from the current top level table and table columns from relationships are options.  <br>\n2- Matching operator. =, >, >=, <, <=, !=, and \"like\" are available.  <br>\n3- Value to filter by. This is the search criteria that will be applied to the table column to filter by. When you static value list this value is filled with the value list value.   \n<br><br>\nPOWER USER TIP: match with a function  \n<br>Notice that there are two filter types: \"Value\" and \"Function\". \"Value\" works as described above.  The \"Function\" type allows you to apply a method to return the parameter to filter by instead of a static value. For example this allows you to return the current date.  You can also pass an argument to the function. \n<br><br>\nExample: create a function that returns a date search string starting x amount of days from today and ending with today. This search string will be matched up with a date field. Use the argument field to specify how many days before today you want the range to be.  This means you can use the same function on filters labeled \"Last 30 days\", \"Past week\", and \"Today\" by adjusting the argument passed to the function. </body></html>',NULL,1,NULL,'_ds_NAV_engine','NAV_P_action_item_filter','help_button_filter_setup'),
 (530,'5054a8b5-62d3-4d4d-befe-bb9570fa6e2c','2008-10-31 11:57:18','2008-11-04 11:22:19','en','Button: Reports','Add reports from the registered reports list on the right to be triggered from this navigation item.  Use the controls to remove and/or reorder report items.  You can also use the registered report combobox to select a different registered report for this report item. Useful when you have a lot of registered reports.  Register reports in the report registry configuration pane. Reports registered there are available throughout your solution. See that section for more inline help.',NULL,1,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__button_2F_action_item__report','help_button_reports'),
