 (629,'b3df80d2-a1d6-439a-a0e8-371b63ff1287','2008-10-31 11:57:25','2008-11-04 11:22:19','en','Clear field',NULL,NULL,NULL,NULL,'_ds_NAV_engine','NAV_0F_navigation_item_1F__detail','btn_clear_space_default'),
